/*Table structure for table `chits` */

DROP TABLE IF EXISTS `chits`;

CREATE TABLE `chits` (
  `Chit_No` varchar(10) NOT NULL DEFAULT '',
  `Chit_Name` varchar(100) DEFAULT NULL,
  `Chit_Amount` float DEFAULT NULL,
  `Installment_Amount` float DEFAULT NULL,
  `No_Installments` float DEFAULT NULL,
  `Closed` char(1) DEFAULT NULL,
  PRIMARY KEY (`Chit_No`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

