DROP TABLE IF EXISTS `chits_bidding`;

CREATE TABLE `chits_bidding` (
  `Record_ID` int(11) NOT NULL AUTO_INCREMENT,
  `Chit_RecordID` int(11) DEFAULT NULL,
  `Installment_No` int(11) DEFAULT NULL,
  `Bid_Amount` float DEFAULT NULL,
  `Bid_Date` datetime DEFAULT NULL,
  `Customer_ID` int(11) DEFAULT NULL,
  `Left_Amount` float DEFAULT NULL,
  PRIMARY KEY (`Record_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

