  `Rate` float DEFAULT NULL,
  `Pay_mode` int(11) DEFAULT NULL,
  `Cheque_no` varchar(10) DEFAULT NULL,
  `Bank_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`Hl_loanno`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

